package com.example.antriankesehatan.modelimport com.google.gson.annotations.SerializedNamedata class RegisterResponse(	@field:SerializedName("data")	val data: DataRegister? = null,	@field:SerializedName("meta")	val meta: MetaRegister? = null)data class DataRegister(	@field:SerializedName("access_token")	val accessToken: String? = null,	@field:SerializedName("token_type")	val tokenType: String? = null,	@field:SerializedName("user")	val user: UserRegister? = null)data class UserRegister(	@field:SerializedName("no_tlp")	val noTlp: String? = null,	@field:SerializedName("roles")	val roles: String? = null,	@field:SerializedName("created_at")	val createdAt: String? = null,	@field:SerializedName("email_verified_at")	val emailVerifiedAt: Any? = null,	@field:SerializedName("alamat")	val alamat: String? = null,	@field:SerializedName("password")	val password: String? = null,	@field:SerializedName("photoProfile")	val photoProfile: Any? = null,	@field:SerializedName("updated_at")	val updatedAt: String? = null,	@field:SerializedName("no_bpjs")	val noBpjs: String = "-",	@field:SerializedName("name")	val name: String? = null,	@field:SerializedName("id")	val id: Int? = null,	@field:SerializedName("jenis_kelamin")	val jenisKelamin: String? = null,	@field:SerializedName("email")	val email: String? = null)data class MetaRegister(	@field:SerializedName("code")	val code: Int? = null,	@field:SerializedName("message")	val message: String? = null,	@field:SerializedName("status")	val status: String? = null)